DROP TABLE IF EXISTS `person`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8mb4 */;
CREATE TABLE `person` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'id',
  `name` varchar(128) DEFAULT NULL COMMENT '游戏id',
  `god` varchar(30) DEFAULT NULL COMMENT '主神: 比湿奴 湿婆 梵天',
  `union_name` varchar(100) DEFAULT NULL COMMENT '战盟',
  `job` varchar(100) DEFAULT NULL COMMENT '职业',
  `level` varchar(20) DEFAULT NULL COMMENT '主神等级',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `create_by` int(10) unsigned DEFAULT NULL,
  `update_by` int(10) unsigned DEFAULT NULL,
  `player_group_id` int(11) DEFAULT NULL COMMENT '关联到玩家分组ID',
  PRIMARY KEY (`id`),
  UNIQUE KEY `index_name` (`name`),
  KEY `idx_player_group_id` (`player_group_id`),
  CONSTRAINT `fk_person_player_group` FOREIGN KEY (`player_group_id`) REFERENCES `player_group` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1160 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
